import React  from 'react';
import PropTypes from 'prop-types';
import { Modal, ModalHeader, ModalBody, ModalFooter } from 'reactstrap';
import IBase from '../Base.js'

const propTypes = {
  header: PropTypes.string,
  footer: PropTypes.element
};

const defaultProps = {
  header: 'Modal title',
  footer: <p>Close button </p>
};

class IModal extends IBase {

  render() {
    let {
      header,
      footer,
      ...attributes
    } = this.props;

    if (attributes.children === undefined) {
       attributes.children = <p>This is a modal. </p>
    }

    const children = (
        <ModalBody>
            {attributes.children}
        </ModalBody>
    );

    const modal = (
      <Modal
        {...attributes}
      >
        {header !== undefined ? <ModalHeader> { header } </ModalHeader> : null}
        {children}
        {footer !== undefined ? <ModalFooter className="text-muted"> { footer } </ModalFooter> : null}
      </Modal>
    );

    return super.render(modal);
  }
}

IModal.propTypes = propTypes;
IModal.defaultProps = defaultProps;
IModal.displayName = 'IModal';

export default IModal;
